import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import classes from "./Nav.module.css";

function Nav() {

  const [windowWidth, setWindowWidth] = useState(window.innerWidth);

  useEffect(() => {
    if(window.innerWidth < 1000){
      console.log('small')
    }
  }, [windowWidth])

  return (
    <nav className={classes.nav}>
      <ul className={classes.ul}>
        <li>
          <Link className={classes.li} to="/">
            Home
          </Link>
        </li>

        <li>
          <Link className={classes.li} to="/App">
            App
          </Link>
        </li>
        <li>
          <Link className={classes.li} to="/cnftdata">
            CNFT Data
          </Link>
        </li>
        <li>
          <Link className={classes.li} to="/cryptodata">
            Crypto Data
          </Link>
        </li>
        <li>
          <Link className={classes.li} to="/plans">
            Plans
          </Link>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
